import { Link } from "react-router-dom";

const Navbar = () => {
    return (
        <div className="navbar-main">
            <div className="navbar-container">
                <Link to="/">Home</Link>
                <Link to="/movies">Movies</Link>
                <Link to="/login">Login</Link>
                <Link to="/sign-up">Sign-up</Link>
            </div>
        </div>
    );
}

export default Navbar;
